import React from 'react';

import logoImg from '../../assets/logo.svg';

import { Title, Form, Repositories } from './styles';

const Dashboard: React.FC = () => {
  return (
    <>
      <img src={logoImg} alt="Github Explorer" />
      <Title>Explore repositórios no Github</Title>

      <Form>
        <input placeholder="Digite o nome do repositório" type="text" />
        <button type="submit">Pesquisar</button>
      </Form>

      <Repositories>
        <a href="teste">
          <img
            src="https://avatars3.githubusercontent.com/u/48629624?s=460&u=4b7b7a11b2fdf57e66c164d9bf8f05ef3c91f85f&v=4"
            alt="Lucas Procopio"
          />
          <div>
            <strong>be-the-hero</strong>
            <p>Semana Omnistack 11</p>
          </div>
        </a>
      </Repositories>
    </>
  );
};

export default Dashboard;
